import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import "./Navbar.css";

export default function Navbar() {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  return (
    <nav className="navbar">
      <div className="navbar-left" onClick={() => navigate("/")}>
        <img src="/logo.png" alt="ConVINCE Logo" className="navbar-logo" />
        <h1 className="navbar-title">ConVINCE Notes</h1>
      </div>

      <div className="navbar-links">
        <Link to="/">Home</Link>
        <Link to="/innovation-collaboration">Innovation</Link>
        <Link to="/building-teamwork">Teamwork</Link>
        <Link to="/future-collaboration">Future</Link>
      </div>

      <div className="navbar-auth">
        {user ? (
          <>
            <span className="navbar-user">Hi, {user.name}</span>
            <button
              className="navbar-btn logout"
              onClick={() => {
                logout();
                navigate("/login");
              }}
            >
              Logout
            </button>
          </>
        ) : (
          <>
            <button
              className="navbar-btn"
              onClick={() => navigate("/login")}
            >
              Login
            </button>
            <button
              className="navbar-btn register"
              onClick={() => navigate("/register")}
            >
              Register
            </button>
          </>
        )}
      </div>
    </nav>
  );
}
